import React from 'react';
import { TextInput, StyleSheet} from 'react-native';

const Input = props => {
    return <TextInput style={{ ...styles.input, ...props.style }} />;
};

const styles = StyleSheet.create({
    input: {
        height: 30,
        borderBottomColor: 'red',
        borderBottomWidth: 1,
        marginVertical:10 
    }
});

export default Input;
